script: |
  super -f text -I q11363.spq | sort > q11363.out

inputs:
  - name: q11363.spq
    data: |
      SELECT DISTINCT + 3 AS col0 FROM tab1 (FORMAT parquet), tab2 (FORMAT parquet) AS cor0 CROSS JOIN tab1 (FORMAT parquet) AS cor1;
  - name: tab1
  - name: tab2

outputs:
  - name: q11363.out
    data: |
      3
